df = pd.DataFrame.from_records(cellp)


df.columns = [
    "aa_model",
    "aa_developer",
    "aa_date",
    "aa_android",
    "aa_year",
    "aa_month",
    "aa_vnumber",
    "aa_vnumber_float",
    "aa_model_adb",
]
df["aa_model_adb"] = df["aa_model_adb"].str.strip("\\").str.strip()


def change_model_and_uuid(
    adb_path,
    deviceserial,
    modelregex=".*",
    developerregex=".*",
    androidfullnameregex=".*",
    year=">1",
    month=">0",
    versionnumberaround=7.05,
    change_device=True,
    change_uuid=True,
):
    df12 = get_android_cellphones(
        modelregex=modelregex,
        developerregex=developerregex,
        androidfullnameregex=androidfullnameregex,
        year=year,
        month=month,
        versionnumberaround=versionnumberaround,
        howmany=1,
        return_list=True,
    )

    phone, uu = df12[0][-2], df12[0][-1]
    if change_device:
        execute_multicommands_adb_shell(
            adb_path,
            deviceserial,
            [
                f"""settings put global device_name {phone.strip().strip(os.sep).strip()}"""
            ],
        )
    if change_uuid:
        execute_multicommands_adb_shell(
            adb_path, deviceserial, [f"""settings put secure android_id {uu.strip()}"""]
        )

    newid = (
        b"".join(
            execute_multicommands_adb_shell(
                adb_path,
                deviceserial,
                [
                    f"content query --uri content://settings/secure --where \"name='android_id'\""
                ],
            )
        )
        .split(b"value=")[-1]
        .strip()
        .decode("utf-8", "ignore")
    )
    newdev = (
        b"".join(
            execute_multicommands_adb_shell(
                adb_path,
                deviceserial,
                [
                    f"content query --uri content://settings/global --where \"name='device_name'\""
                ],
            )
        )
        .split(b"value=")[-1]
        .strip()
        .decode("utf-8", "ignore")
    )
    return newid, newdev


def connect_to_adb(adb_path, deviceserial):
    _ = subprocess.run(f"{adb_path} start-server", capture_output=True, shell=False)
    _ = subprocess.run(
        f"{adb_path} connect {deviceserial}", capture_output=True, shell=False
    )


def execute_multicommands_adb_shell(
    adb_path,
    device_serial,
    subcommands: list,
    exit_keys: str = "ctrl+x",
    print_output=True,
    timeout=None,
):
    if not isinstance(subcommands, list):
        subcommands = [subcommands]
    subcommands.insert(0, "su")
    return execute_subprocess_multiple_commands_with_timeout_bin(
        cmd=f"{adb_path} -s {device_serial} shell",
        subcommands=subcommands,
        exit_keys=exit_keys,
        end_of_printline="",
        print_output=print_output,
        timeout=timeout,
    )


def get_uuid(len_=16):
    return str(uuid.uuid4()).replace("-", "")[:len_]


def get_android_cellphones(
    modelregex=".*",
    developerregex=".*",
    androidfullnameregex=".*",
    year=">1",
    month=">0",
    versionnumberaround=7.05,
    howmany=10,
    return_list=True,
):

    dfa = df.loc[
        (df.aa_model.str.contains(modelregex, regex=True, na=False))
        & (df.aa_model.str.contains(modelregex, regex=True, na=False))
        & (df.aa_developer.str.contains(developerregex, regex=True, na=False))
        & (df.aa_android.str.contains(androidfullnameregex, regex=True, na=False))
        & (eval(f"df.aa_year {year}"))
        & (eval(f"df.aa_month {month}"))
    ]
    indexsmaller, indexbigger = dfa.aa_vnumber_float.s_find_closest_neighbours(
        value=versionnumberaround, convertdtypes=True, accept_exact_match=True
    )

    allindi = (
        indexsmaller.lower_index.astype(int).to_list()
        + indexbigger.upper_index.astype(int).to_list()
    )
    goodcell = df.loc[allindi]
    if howmany <= len(goodcell):
        replace = False
    else:
        replace = True
    results = goodcell.sample(howmany, replace=replace).copy().reset_index(drop=True)
    results["uuid"] = [get_uuid() for x in range(len(results))]
    if return_list:
        return list(results.ds_to_tuples(index=False, columns=False))
    return results


class AdbChanger:
    def __init__(
        self,
        adb_path,
        deviceserial,
    ):
        self.adb_path = adb_path
        self.deviceserial = deviceserial

    def connect_to_device(self):
        connect_to_adb(self.adb_path, self.deviceserial)

    def change_device_name(
        self,
        modelregex=".*",
        developerregex=".*",
        androidfullnameregex=".*",
        year=">1",
        month=">0",
        versionnumberaround=7.05,
    ):
        return change_model_and_uuid(
            self.adb_path,
            self.deviceserial,
            modelregex=modelregex,
            developerregex=developerregex,
            androidfullnameregex=androidfullnameregex,
            year=year,
            month=month,
            versionnumberaround=versionnumberaround,
            change_device=True,
            change_uuid=False,
        )

    def change_android_id(self):
        return change_model_and_uuid(
            self.adb_path,
            self.deviceserial,
            modelregex=".*",
            developerregex=".*",
            androidfullnameregex=".*",
            year=">1",
            month=">0",
            versionnumberaround=7.05,
            change_device=False,
            change_uuid=True,
        )

    def change_android_id_and_device_name(
        self,
        modelregex=".*",
        developerregex=".*",
        androidfullnameregex=".*",
        year=">1",
        month=">0",
        versionnumberaround=7.05,
    ):
        return change_model_and_uuid(
            self.adb_path,
            self.deviceserial,
            modelregex=modelregex,
            developerregex=developerregex,
            androidfullnameregex=androidfullnameregex,
            year=year,
            month=month,
            versionnumberaround=versionnumberaround,
            change_device=True,
            change_uuid=True,
        )

    @staticmethod
    def get_random_android_cellphones(
        modelregex=".*",
        developerregex=".*",
        androidfullnameregex=".*",
        year=">1",
        month=">0",
        versionnumberaround=7.05,
        howmany=10,
        return_list=True,
    ):
        return get_android_cellphones(
            modelregex=modelregex,
            developerregex=developerregex,
            androidfullnameregex=androidfullnameregex,
            year=year,
            month=month,
            versionnumberaround=versionnumberaround,
            howmany=howmany,
            return_list=return_list,
        )

